import React, {Component} from 'react';
import {Link} from 'react-router-dom';
import {Nav, Navbar} from 'react-bootstrap'

class Navigation extends Component {
  render() {
    return (
      // put in fixed top or sticky top later
      // <Navbar expand="lg" bg="light">
