      //       <Nav.Link>blog</Nav.Link>
      //       <Nav.Link>contact</Nav.Link>
      //     </Nav>
      // </Navbar>
      <nav className="global-nav">
        <ul>
          <li><Link to="/">Alex Do</Link></li>
          <li>about</li>
          <li><Link to="/About">software</Link></li>
          <li>blog</li>
          <li>contact</li>
        </ul>
      </nav>

    );
  }
}


export default Navigation;
